import React, { FC } from 'react';
import { FilmCard } from '../film-card';
import './film-list.scss';
import { FilmListProps } from './film-list.types';

const FilmList: FC<FilmListProps> = ({ filmList, genres }) => {
  return (
    <div className="filmListWrapper">
      {filmList?.[0] ? (
        filmList?.map(({ id, poster_path, genre_ids, title, release_date }) => (
          <FilmCard
            key={id}
            image={poster_path}
            genreIds={genre_ids}
            title={title}
            year={release_date}
            genres={genres}
          />
        ))
      ) : (
        <div>no results</div>
      )}
    </div>
  );
};

export { FilmList };
